import getstartedimg from "./images/getstartedimg.svg"
import Common from "./Common";

const About = () => {
    return (
        <>
            <Common name="Welcome to about page of" imgsrc={getstartedimg} visit="/contact" btnname="Contact Now" />
        </>
    )
}

export default About;
